import React, { Component } from 'react';
import ListsAPI from '../../api/ListsAPI';
import NamesAPI from '../../api/NamesAPI';
import '../../App.css';
import '../../pages/ListNamesPage.css'

class NamesDisplay extends Component {

  handleSort = (x) => {
    console.log('HEYA', x)
    let sortHolder = x.sort((a, b) => {
    let A = a.baby_name;
    let B = b.baby_name;
    return (A < B) ? -1: (A > B) ? 1: 0;
  });
  console.log('BYA', sortHolder)
  // return sortHolder.map((name, index) => {
