  //     <div key={index} className='baby-name'>
  //       {name.baby_name.toLowerCase()}<br/>
  //     </div>
  //   )
  // })
}

  displayNames = () => {
    let sortedName = [];
    this.props.names.map(name => {
      sortedName.push(name.baby_name.toUpperCase());
    })
    this.handleSort(sortedName);
  }

  render() {

    return (
      <div>
        {this.displayNames()}
      </div>
    )
  }
}

export default NamesDisplay;
